 /><br />The Software may from time-to-time list promotions of third-party retailers (the "Retailer Promotion Codes"). The Retailer Promotion Codes shall be governed by the terms and conditions of the third-party retailers. You agree that La Concierge does not assume responsibility for any products, content, services, websites, advertisements, offers, or information that is provided by third-party retailers and made available through the Software. If you purchase, use, or access any such products, content, services, advertisements, offers, or information through the Software, you agree that you do so at your own risk and that La Concierge will have no liability based on such purchase. <br /><br /><strong>26- Cancellation and Replacement Policy</strong> <br /><br />** Cancellations will be governed by the Cancellation and Refunds policy on our website. <br /><br />** For our digital shopping application relating to purchase of products, refunds requests may generally be raised citing the following reasons: product received not as described in the Application i.e. wrong product, product received is of the wrong quantity, parcel damaged on arrival, and change of mind of the user. Refunds and / or replacement of products must be directed to La Concierge, and any such refund and / or replacement shall be treated in accordance with the terms and conditions of the retailer. The retailer will generally address the refund request raised by the User within 4 hours and issue a cash refund, or a credit note to the User, in accordance with the retailer's Policy. <br /><br /><strong>27- Payment</strong> <br /><br />We accept payments online using Visa and MasterCard credit/debit cards in AED (or any other agreed currency). <br /><br /><strong>28- Security Capabilities Policy for Transmission of Payments</strong> <br /><br />** What information do we collect and how do we use it? When you place an order through this website, you need to know your name, email, phone number, address, and credit card details, if paying by card. This information &shy;allows us to process and fulfill your or&shy;der successfully. It also helps us in ma&shy;intaining your account. ** How do we protect customer information? When you place orders, we use a secure server. The secure server software encrypts all information you input before it is sent to us. Furthermore, all the sensitive customer data we collect is protected by several layers of encryption and several layers of security to prevent unauthorized access. ** Payment options: All our payment options are safe and secure. All credit card payments are processed securely. La Concierge does not store any payment details or store credit card information on our servers. <br /><br /><strong>29- Delivery/Shipping policy</strong> <br /><br />** www.leconciergeapp.ae will not deal or provide any services or products to any of the Office of Foreign Assets Control sanctions countries in accordance with the law of UAE. ** You may not use, export or re-export any materials from this App in violation of any applicable laws or regulations, including, but not limited to any UAE export laws and regulations. <br /><br /><strong>30- Governing Law and Jurisdiction</strong> <br /><br />** United Arab Emirates is our Country of Domicile. We control the Software and application from the U.A.E. We make no representation that this Software is appropriate for use in other locations. If you use this Software from other locations, you are responsible for ensuring compliance with local laws. ** Any purchase, dispute or claim arising out of or in connection with this website and Agreement shall be governed and construed in accordance with the laws of UAE. ** Any dispute, contest and claim related to this Agreement shall be subject to the exclusive jurisdiction of the courts of Dubai, United Arab Emirates.</p>	<p>Terms And Conditions</p>	\N	\N	\N	2023-12-27 11:09:03	2024-03-05 13:48:29
2	Privacy Policy	Privacy Policy	1	<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">Thank you for using La Concierge!</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We are committed to providing you the best online shopping and delivery experience possible, while protecting your privacy and confidentiality according to the terms below.<br /><br /></span><span style="font-size: 16.0pt; line-height: 107%;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 107%; font-family: 'Calibri',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">La Concierge LLC. Dubai , a main office of&nbsp; company, established in Dubai, United Arab Emirates under license number 1278104</span></span><span lang="EN-US" style="font-size: 16.0pt; line-height: 107%; mso-ansi-language: EN-US;">&nbsp;and having its registered address at 1001, Concord Tower, Media City, Dubai United Arab Emirates ("La Concierge"), regarding your use of the software 'La Concierge' ("Software"). La Concierge is a digital shopping application.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 107%; mso-ansi-language: EN-US;">It offers online product purchase services. When you use these services, you will be sharing some information with us. For you to be aware about your privacy, this privacy policy ("Privacy Policy") sets out the information we collect, how we use it, whom we share it with, and the controls we grant you to access, update, and delete your information. Make sure to read the entire policy to fully understand all the below terms related to your privacy.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">By downloading and using the software, you fully consent to the practices described in this privacy policy, including the disclosure of your information to locations which the authorities in your jurisdiction may not recognise as providing an adequate level of protection for personal data.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">Basic categories of information we collect:</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">1- Information you share with us.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">** When you use the Software, we collect the information that you choose to share with us. For example, our Software requires you to download the Software, create an account, and log in with a password. To make it easier for others to find you, we may also ask you to provide us with some additional information that will be publicly visible on the Software. All information you send through our Software is information saved with us as well. When you contact our customer support team, in any way, we will collect whatever information you share.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">** All credit/debit card details and personally identifiable information will not be stored, sold, shared, rented, or leased to any third parties.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">2- Information from use of the Software</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">Information about your use of the Software such as:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Usage Information: Information about your activity through the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Device Information: information from and about the devices on which you use the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Device Phonebook.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* <strong>Camera and Photos:</strong> images and other information from your device's camera and photos.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* <strong>Location Information: </strong>information about your location. With your permission, we may also collect information about your precise location using methods that include GPS, wireless networks, cell towers, Wi-Fi access points, and other sensors, such as gyroscopes, accelerometers, and compasses.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* <strong>Information Collected by Cookies and Other Technologies:</strong> Some information about your activity, browser, and device, may be collected by cookies and other technologies such as web beacons, web storage, and unique advertising identifiers. We may also use these technologies to collect information when you interact with the Software, we offer through one of our partners. Most web browsers are set to accept cookies by default. If you prefer, you can usually remove or reject browser cookies through the settings on your browser or device. Keep in mind, though, that removing or rejecting cookies could affect the availability and functionality of our services on the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* <strong>Log Information.</strong> We also collect log information when you use the Software. This information includes, among other things: error debugging information, user login/logout, usage duration, pronunciation audio, text, and scoring results.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">3- Information we collect from third parties</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We may collect information that other users of the Software, provide about you when they are using our Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** Use of Information</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* We use the information to provide you with a better version of the Software that we continuously work on improving. Below are elaborated techniques we adopt in this course:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Develop, operate, improve, deliver, maintain, and protect the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Monitor and analyse trends and usage.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Contextualize your experience and applying other labels based on the content.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Provide and improve ad targeting and measurement, including the use of your precise location information (where you grant us permission to collect that information), both on and off our Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Enhance the safety and security of the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Verify your identity and prevent fraud or other unauthorized or illegal activity.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Use the information we collected from cookies and other technology to enhance the Software and your experience throughout the use of the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Enforce our EULA and other usage policies.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** How We Share Information</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We may share information about you in the following ways:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* With third parties, we may share the following:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- Information about you, such as your username, name, and location.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- Information about how you have interacted with the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- Any additional information you have directed us to share.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- The content you post or send. Please note that how widely your content is shared depends on your personal settings and the type of service you are using.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* With our affiliates.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* With third parties, we may share your information with:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- Service providers who perform services on our behalf.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- Business partners that provide services and functionality.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">- Third parties for legal reasons. We may share information about you if we believe that disclosing the information is needed to:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Comply with any valid legal process, governmental request, or applicable law, rule, or regulation.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Investigate, remedy, or enforce potential EULA violations.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Protect the rights, property, and safety of us, our users, or others.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Detect and resolve any fraud or security concerns.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Third parties as part of a merger or acquisition: If La Concierge gets involved in a merger, asset sale, financing, liquidation or bankruptcy, or acquisition of all or some portion of our business to another company, we may share your information with that company before and after the transaction closes.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* We may also share with third parties, such as advertisers, aggregated, non-personally identifiable, or de-identified information.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** Third-Party Content and Integrations</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">The Software may also contain third-party links and search results, third-party integrations, or offer a co-branded or third party-branded service. You may be providing information (including personal information) directly to these said third parties, us, or both. You acknowledge and agree that we are not responsible for how those third parties collect or use your information.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** Analytics and Advertising Services</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Information you share with us.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We may permit other companies use cookies, web beacons, and similar technologies on our Software. These companies may collect information about how you use the Software over time and combine it with similar information from other services and companies. This information may be used to, including but not limited to, analyse and track data, determine the popularity of certain content, and better understand your online activity. Additionally, some companies, including our affiliates, may use information collected on the Software to measure the performance of advertisements and deliver more relevant advertisements on behalf of us or other companies, including on third-party websites and applications.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Information provided by us.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We may collect information about your activity on third-party services that use cookies and other technologies provided by us. We use this information to improve our advertising services, including measuring the performance of advertisements and showing you more relevant advertisements.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** How Long We Keep Your Information</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We store the following information for as long as they are required for users' log in:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Your basic account information, including your name, phone number, and email address.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Location information for different lengths of time-based on how precise it is and which services you use.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Keep in mind that, while our systems are designed to carry out our deletion practices upon deletion of accounts, we cannot promise that deletion will occur within a specific timeframe. There may be legal requirements to store your data and we may need to suspend those deletion practices if we receive a valid legal process asking us to preserve content or if we receive reports of abuse or other Terms of Service violations. Finally, we may also retain certain information in backup for a limited period or as required by law.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** Control over Your Information</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We want you to be in control of your information, so we provide you with the following tools:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* <strong>Download data:</strong> you can access and edit most of your basic account information right on the Software. Because your privacy is important to us, we may ask you to verify your identity or provide additional information before we grant you access or update your personal information. We may also reject your request to access or update your personal information for several reasons, including, the request risks the privacy of other users or if the request if unlawful.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* <strong>Revoking permissions:</strong> if you grant us authorization to use your information, you can always change your mind and simply revoke your permission by changing the settings on your device if your device offers this option. By doing that, services on the Software will lose full functionality.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">* Deletion of the Software.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 16.0pt; line-height: 107%;">** Revisions to the Privacy Policy</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 16.0pt; line-height: 107%;">We may change this Privacy Policy from time to time and such change will be published in the Software and it will be your responsibility to review the changes published in the Software. La Concierge bears no liability in relation to any change it introduces to this Privacy Policy.</span></p>	<p>Privacy Policy</p>	\N	\N	\N	2023-12-27 11:08:53	2024-03-05 14:05:52
